import React from 'react';
import './Product.css';

const Product = (props) => {
    const {name, img, seller, stock,price}= props.product
    return (
        <div className="product">
            <div>
                <img src={img} alt="" />
            </div>
            <div className="product-name">
                <h5>{name}</h5>
                <small> by: {seller}</small><br />
                <p>{price}</p> <br />
                <p>only </p>
                
            </div>
        </div>
    );
};

export default Product;
